import React, { memo } from 'react'

const Vhes = memo((props) => {
    return (
        <>
            {props.data.map((vhe, index) => (
                <div
                    key={index}
                >
                    <div>{vhe.vheId}</div>
                    <div>{vhe.vheName}</div>
                </div>
            ))}
        </>
    )
})

export default Vhes
